import React from "react";
import './Navbar.css'
import { Link } from "react-router-dom";

const Navbar = () => {
  const navStyle = {
    color: 'white'
  }

  return (
    <div>
      <nav>
        <Link to="/">
            <h3>Wild Circus.</h3>
        </Link>
        <ul className="nav-links my-auto">

          <Link style={navStyle} to="/history">
            <li>History</li>
          </Link>

          <Link style={navStyle} to='/contact'>
            <li>Contact</li>
          </Link>

          <Link style={navStyle} to='/shop'>
            <li>Shop</li>
          </Link>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
